import React from "react";
import NavigationBar from "../components/NavigationBar";
import ReactPlayer from "react-player";

const movies = [
  {
    name: "Amygdala",
    url: "https://www.youtube.com/watch?v=uUHGdrWld9I&t=227s",
    premiered: "31 Oct 2024",
    description:
      "Samarth tries to discern what's happening, as he suffers from a series of recurring nightmares of being followed by a mysterious being.",
    credits: "Directed by XYZ, Starring ABC",
  },
  {
    name: "Venus Try Flap",
    url: "https://youtu.be/02Hvr-C6t8Q?si=OttuOXL-pWGpmXhZ",
    premiered: "31 Oct 2024",
    description:
      "In the bustling, mist-laden Silicon City of 2028, Shukra stumbles upon a mysterious bag of oranges.",
    credits: "Directed by UVW, Starring DEF",
  },
];

function MoviesPage() {
  return (
    <div className="page-container">
      <NavigationBar />
      <h1>Movies</h1>
      <div className="movie-list">
        {movies.map((movie, index) => (
          <div key={index} className="movie-item">
            <ReactPlayer
              url={movie.url}
              controls={true}
              width="100%"
              height="180px"
            />
            <div className="movie-details">
              <h3>{movie.name}</h3>
              <p>
                <strong>Premiered:</strong> {movie.premiered}
              </p>
              <p>
                <strong>Description:</strong> {movie.description}
              </p>
              <p>
                <strong>Credits:</strong> {movie.credits}
              </p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default MoviesPage;
